//1)	Display a table from 1 to 10.

public class Taskone {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for (int i = 1; i <= 10; i++) {
			for (int j = 1; j <= 10; j++) {
				System.out.print(i * j);
				System.out.print(" ");
			}
			System.out.print("\n");
		}
	}
}
